import React, { useState, useEffect } from 'react';
import styles from './styles.module.scss';
import { Link } from 'react-router-dom';

const Button = (props) => {
  if (props.fee == 0) {
    setEstar(props.fee);
  } else if (props.fee > 0) {
    setEstar(props.fee * 10000);
  }
};

export default Button;
